import React, { useEffect } from "react";

function Tick() {
  useEffect(() => {
    const timer = setTimeout(() => {
      return element;
    }, 1000);
    return () => clearTimeout(timer);
  }, []);
  const element = (
    <div>
      <h1>Hello, world!</h1>
      <h2>It is {new Date().toLocaleTimeString()}.</h2>
    </div>
  );
}

export default Tick;
